Jamie Gillis, Colleen Brennan, R Bolla, Melanie Scott, Tamara Longley, Joey Silvera, John Leslie

A steamy detective yarn about a sizzling female cop stalking a cold-blooded murderer, Trinity Brown takes us through the underworld of hot-blooded, super-sexed gangsters, strippers, pimps, call girls and cheap street hoods.A notorious ... Full Descriptiongangster has just been murdered. The case falls into the lap of Trinity Brown (Colleen Brennen), a stunning redhead and no-nonsense female detective. While there is no love lost between her and the victim, Trinity performs her job like a pro and everyone in town feels the heat.Desperate for a solution, Trinity pulls out all the stops, and with the aid of her sexual charms, sets a trap for the killer. We won't give away the ending, but it is a steamy trip from start to finish.
